        entity,\\\" resulting in the arrests of two developers: Alexey Pertsev (The
        Netherlands, 2022) and Roman Storm (The U.S., 2023). Arrests of Roman Storm
        and Alexey Pertsev are considered a <a href=\\\"https://www.forbes.com/sites/digital-assets/2023/08/25/tornado-cash-co-founders-charged-in-the-us-with-more-than-1-billion-in-money-laundering/?sh=5e3d76187b99\\\"
        rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\"><em>direct attack</em></a>
        on the open-source development space and may have devastating consequences
        for developers who write and publish code.</p><p><br></p><p>On May 14, 2024,
        Alexey Pertsev was <a href=\\\"https://www.dlnews.com/articles/people-culture/alexey-pertsev-accused-of-laundering-1bn-at-tornado-cash/\\\"
        rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\"><em>found guilty</em></a>
        of money laundering by a Dutch court and received a maximum sentence of 64
        months in prison. He is now appealing the court's decision and accepting donations
        via <a href=\\\"WeWantJusticeDAO.org\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\"><em>WeWantJusticeDAO.org</em></a>.</p><p><br></p><p>Roman
        Storm's trial in the US is scheduled to take place in the Southern District
        of New York in early December 2024. Its outcome will set precedents for privacy
        in web3 and the freedom to publish code without fear of government persecution.
        Roman's most recent court hearing took place on <a href=\\\"https://www.coindesk.com/policy/2024/07/12/conduct-versus-code-may-be-the-defining-question-in-roman-storm-prosecution/\\\"
        rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\"><em>July 12, 2024</em></a><em>,</em>
        and focused on the motions filed by his legal team. </p><p><br></p><p>Prior
        to the current Juicebox.Money campaign cycle, Roman and Alex had raised here
        an impressive 655 ETH via community support, and all donations had been used
        to cover costs for multiple legal teams committed to defending Alexey and
        Roman across different jurisdictions. Complete breakdown of associated funding
        and costs can be found<em> </em><a href=\\\"https://docs.google.com/spreadsheets/d/1P69NhyLshI6kwfo7KqaA_rNUV5vpRw9JTJOfFAsdqAk/edit?usp=sharing\\\"
        rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\"><em>here.</em></a></p><p><br></p><p>The
        current cycle is focusing on fundraising for Roman Storm's defense and the
        associated costs in preparation for his US trial, which is expected to be
        the largest expense in 2024.</p><p><br></p><p><br></p><h2>How to Help</h2><p><br></p><p>In
        preparation for the trial, Roman's legal costs have increased to ~$500k/mo,
        and the next few months will be crucial in completing his robust defense strategy.
        As such, he currently needs an additional $2-$3 million to see this case through.</p><p><br></p><p>Please
        contribute towards this important cause - your donation will have a huge impact
        on the future of privacy in the blockchain industry.</p><p><br></p><p><strong>Help
        defend the right to privacy and the right to publish code!</strong></p>\",\"twitter\":\"FreeAlexeyRoman\",\"discord\":\"discord.com/invite/JSNDapxkHc\",\"telegram\":\"\",\"tokens\":[],\"tags\":[\"fundraising\",\"social\",\"nfts\"],\"domain\":\"juicebox\",\"version\":10,\"projectTagline\":\"Legal
